plovr.viewSourceUrl_ = '';

/** @param {string} viewSourceUrl */
plovr.setViewSourceUrl = function(viewSourceUrl) {
  plovr.viewSourceUrl_ = viewSourceUrl;
};

/** @return {string} */
plovr.getViewSourceUrl = function() {
  return plovr.viewSourceUrl_;
};

